__NUXT_JSONP__("/drugs/Onalespib_Lactate", (function(a,b,c,d){return {data:[{drug:{slug:a,emaEpar:[],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"1019889-35-0",chebiId:b,chemicalFormula:b,definition:"The lactate form of onalespib, a synthetic, orally bioavailable, small-molecule inhibitor of heat shock protein 90 (Hsp90) with potential antineoplastic activity. Onalespib selectively binds to Hsp90, thereby inhibiting its chaperone function and promoting the degradation of oncogenic signaling proteins involved in tumor cell proliferation and survival. Hsp90, a chaperone protein upregulated in a variety of tumor cells, regulates the folding, stability and degradation of many oncogenic signaling proteins.",fdaUniiCode:"66226JUH2I",identifier:"C129425",preferredName:c,semanticType:"Pharmacologic Substance",subclassOf:["C156880"],synonyms:["AT-13387 Lactate","ATI-13387A","ATI-13387AU","ONALESPIB LACTATE",c,"Propanoic Acid, 2-Hydroxy-, (2S)-, Compound with (1,3-Dihydro-5-((4-methyl-1-piperazinyl)methyl)-2H-isoindol-2-yl)(2,4-dihydroxy-5-(1-methylethyl)phenyl)methanone (1:1)"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FOnalespib_Lactate",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("Onalespib_Lactate","","Onalespib Lactate","2021-10-30T13:31:10.803Z")));